import React from "react";
//import logo from './logo.svg';
import "./App.css";
import { BrowseRouter as Route, Router, Switch } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path='/'>HI</Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
